import React, { Component } from 'react';

import TodoItems from './TodoItems'

class ListContainer extends Component{
    render(){
        return(
            <TodoItems 
                entries={this.props.entries}
                deleteItem={this.props.deleteItem}/> 
        )
    }
}

export default ListContainer;
